  return (
    <>
      <Nav />
      <div className="main">
        <Hero />
        <div className="success">
          <div className="ui_message_success">
            Thank you! Your reservation has been succesfully submitted
          </div>
        </div>
      </div>
      <Footer />
    </>
  );
};

export default ConfirmationPage;
